import React from "react";

const ImageLinkForm = () => {
    return (
        <div className="flex flex-wrap justify-center">
            <p className="white f4 w-100 tc">
                {`Insert some image url below to detect a face: `}
            </p>
            <input className="pa2 f4 w-70 center" type="text" plaeholder="Image"/>
            <button className="bg-gray mt3 pv2 w-50">Detects</button>
        </div>
    )
}

export default ImageLinkForm
